import React from "react";
import Item from "./Item";
import CreateItem from "./CreateItem";
import { Box } from "@chakra-ui/core";

export default function TabCard({
  id,
  name,
  balance,
  user_name,
  items,
  site_number,
  categories,
  common_items,
  newItem,
  queryCache,
}) {
  return (
    <Box border="1px solid black" textAlign="center" color="white">
      <Box bg="fourth100" border="none" rounded="10px">
        <p>Tab Name: {name}</p>
        <p>Site # {site_number}</p>
        <p>User's Name: {user_name}</p>
        <p>Balance: {balance}</p>
        <CreateItem
          tab_id={id}
          categories={categories}
          common_items={common_items}
          newItem={newItem}
        />
      </Box>

      <Box borderBottom="1px solid gray" mx="5%" />
      <p>Tab Items: </p>
      {items.map((item, index) => (
        <div key={index}>
          <Item
            id={item.id}
            name={item.name}
            price={item.price}
            date={item.created_at}
            category={item.category}
            queryCache={queryCache}
          />
        </div>
      ))}
    </Box>
  );
}
